import { withStyles } from "@material-ui/core/styles";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}

        <h1>Shopping List</h1>
        <Button
          className="signup-btn"
          variant="contained"
          color="secondary"
          style={{ withStyles }}
        >
          Sign Up
        </Button>
        <Button
          className="login-btn"
          variant="outlined"
          color="primary"
          onClick={() => {
            Login;
          }}
        >
          Log In
        </Button>
